import React from 'react';

function Food({name}){
  return <h1>I am a {name}</h1>;
}

const foodName = [
  {name: "kimchi"},
  {name: "ramyeon"},
  {name: "coffee"}
]

function App() {
  return (
    <div>
      {foodName.map(dish => (
        <Food name={dish.name} />
      ))}
    </div>
  );
}

export default App;
